import React from 'react'
import Gradients from './Gradients.tsx'
import "./Taskbar.sass"
import { RiFolder2Line, RiFirefoxLine } from "react-icons/ri";

function Taskbar() {
    return (
        <div className='taskbar'>


            <RiFirefoxLine className='taskbar-folder' style={{ fill: "url(#blue-gradient)" }} />
            <RiFirefoxLine className='taskbar-folder' style={{ fill: "url(#blue-gradient)" }} />
            <RiFirefoxLine className='taskbar-folder' style={{ fill: "url(#blue-gradient)" }} />
            <RiFirefoxLine className='taskbar-folder' style={{ fill: "url(#blue-gradient)" }} />
        </div>
    )
}

export default Taskbar
